import React, { Component } from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import BootstrapTable from 'react-bootstrap-table-next';
import ToolkitProvider, { Search } from 'react-bootstrap-table2-toolkit';


const { SearchBar } = Search;

class SearchTable extends Component {
  state = {
    products: [
      {
        'name': 'metamask',
        'category' : 'Wallet',
        website : 'test',
        file: 'test2'

      },
      {
        'name': 'OpenSea',
        'category' : 'Exchange',
        website : 'drfgbfsgn',
        file: 'trn'
      },
      {
        'name': 'Ledger',
        'category' : 'Wallet',
        website : 'sdvsv',
        file: 'sdvdfn'
      },
    ],
    columns: [{
      dataField: 'name',
      text: 'Dapp Name',
      sort: true
    },
    {
      dataField: 'category',
      text: 'Category',
      sort: true
    }, {
      dataField: 'website',
      text: 'Dapp Link',

    }, {
      dataField: 'file',
      text: 'File Link',

    }]
  }

  render() {
    return (
      <div className="container" style={{ marginTop: 50 }}>

      <ToolkitProvider
        keyField="id"
        data={ products }
        columns={ columns }
        search
      >
        {
          props => (
            <div>
              <h3>Input something at below input field:</h3>
              <SearchBar { ...props.searchProps } />
              <hr />
              <BootstrapTable
                { ...props.baseProps }
              />
            </div>
          )
        }
      </ToolkitProvider>


        <BootstrapTable SearchTable
        striped
        hover
        keyField='id'
        data={ this.state.products }
        columns={ this.state.columns } />
      </div>
    );
  }
}

export default SearchTable;
